import{
    Login,
    Dashboard,
    DataList,
} from '../views';

export const MainRoutes = [
    {
        path: '/login',
        component: Login
    },
    {
        path: '/dashboard',
        component: Dashboard
    },
    {
        path: '/data_list',
        component: DataList
    },
];
